    //edit description function

    const getData = async () => {
        try {
            const response = await fetch(`http://localhost:3080/see/cpu/${todo.id_cpu}`, {
                method: "GET",
                headers: { "Content-Type": "application/json" },
            });
            const jsonData = await response.json();

            setTodos2(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    };

    useEffect(() => {
        console.log(todo.id_cpu);
        getData();
    }
        , []);

    return (
        <Fragment>
            <h3>CPU Detail: {cpu.name} , Clock: {cpu.core} </h3>
        </Fragment>
    );
};

